import React, { useState } from "react";

const Editar = (pelicula, datos, setDatos) => {
  const actualizarInformacion = (e) => {
    e.preventDefault();
    let datos = e.target.titulo.value;
    console.log(datos);
  };
  //render del componente

  return (
    <>
      <form
        style={{ textAlign: "center", color: "black" }}
        onSubmit={actualizarInformacion}
        className="edit_form"
      >
        <input
          type="text"
          name="titulo"
          id="titulo"
          className="edit_form"
          defaultValue={pelicula.pelicula.titulo}
        />
        <input
          type="text"
          name="descripcion"
          id="descripcion"
          className="edit_form"
          defaultValue={pelicula.descripcion}
        />
        <input type="submit" value="Actualizar" />
      </form>
    </>
  );
};

export default Editar;
